import "./App.css";
import Image from "material-ui-image";
import Paper from "material-ui/Paper";
function App() {
  return (
    <div className="App">
      <Paper style={styles.paperContainer}>
        Some text to fill the Paper Component
      </Paper>
      <h1>Hello</h1>
    </div>
  );
}

export default App;
